import { useEffect, useState } from "react";
import * as React from "react";
import { View, Text } from "react-native";

const Navbar = () => {
    return ( <View>
        <Image
        style={styles.tinyLogo}
        source={{
          uri: '../../pics/SpendWell.png',
        }}
      />
        <Text>Im a navbar!!</Text>
    </View> );
}

export default Navbar;
